import Animate from "animate.css-react";
MainPageAnimation = (props) => {
    return (
      <Animate
        appear="fadeInUP"
        leave="fadeOutUp"
        durationAppear={1000}
        durationLeave={1000}
        component="div"
      >
          {props.children}
      </Animate>
    );
};
export default MainPageAnimation;
